import React from "react";
import Hero from "./Hero";
import LeftImage from "./LeftImage";
import RightImage from "./RightImage";
import Universe from "./Universe";

function ProductsPage() {
  return (
    <>
      <Hero />
      <LeftImage />
      <RightImage />
      <Universe />
    </>
  );
}

export default ProductsPage;
